import React, { useState } from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';
import { CarFront, Award, Timer, Flag, Trophy } from 'lucide-react';

const F1Predictor = () => {
  const [predictions, setPredictions] = useState(null);
  const [loading, setLoading] = useState(false);
  const [formData, setFormData] = useState({
    gridPosition: 1,
    q1Time: 80.0,
    q2Time: 0.0,
    q3Time: 0.0,
    teamPoints: 0,
    teamAvgPoints: 0.0,
    driverPoints: 0,
    recentAvgPosition: 10.0,
    constructor: 0,
    track: 0,
    laps: 50,
    raceRound: 1
  });

  const constructors = [
    "Mercedes", "Red Bull", "Ferrari", "McLaren", "Alpine",
    "AlphaTauri", "Aston Martin", "Williams", "Alfa Romeo", "Haas"
  ];

  const tracks = [
    "Bahrain", "Saudi Arabia", "Australia", "Azerbaijan", "Miami",
    "Monaco", "Spain", "Canada", "Austria", "Britain", "Hungary",
    "Belgium", "Netherlands", "Italy", "Singapore", "Japan",
    "Qatar", "USA", "Mexico", "Brazil", "Vegas", "Abu Dhabi"
  ];

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: typeof prev[name] === 'number' ? Number(value) : value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    try {
      const response = await fetch('http://localhost:5000/api/predict', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData)
      });
      const data = await response.json();
      setPredictions(data);
    } catch (error) {
      console.error('Error:', error);
    } finally {
      setLoading(false);
    }
  };

  // Custom gauge component for predictions
  const PredictionGauge = ({ value, label }) => {
    const percentage = value * 100;
    const color = percentage > 66 ? '#22c55e' : percentage > 33 ? '#eab308' : '#ef4444';

    return (
      <div className="relative w-full h-32 flex flex-col items-center justify-center">
        <div className="absolute w-32 h-32">
          <svg viewBox="0 0 100 100">
            <path
              d="M 50,50 m 0,-47 a 47,47 0 1 1 0,94 a 47,47 0 1 1 0,-94"
              stroke="#e5e7eb"
              strokeWidth="6"
              fillOpacity="0"
            />
            <path
              d="M 50,50 m 0,-47 a 47,47 0 1 1 0,94 a 47,47 0 1 1 0,-94"
              stroke={color}
              strokeWidth="6"
              fillOpacity="0"
              style={{
                strokeDasharray: `${percentage * 2.96}, 296`,
                transition: 'stroke-dasharray 0.5s ease'
              }}
            />
          </svg>
        </div>
        <div className="mt-2 text-center">
          <div className="text-3xl font-bold">{percentage.toFixed(1)}%</div>
          <div className="text-gray-500">{label}</div>
        </div>
      </div>
    );
  };

  return (
    <div className="min-h-screen bg-gray-50 py-8">
      <div className="max-w-7xl mx-auto px-4">
        {/* Header */}
        <div className="text-center mb-8">
          <h1 className="text-4xl font-bold flex items-center justify-center gap-2 text-gray-900">
            <CarFront className="h-10 w-10 text-blue-600" />
            F1 Race Predictor
          </h1>
          <p className="mt-2 text-gray-600">Enter race information to predict outcomes</p>
        </div>

        <form onSubmit={handleSubmit} className="space-y-6">
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
            {/* Qualifying Section */}
            <div className="bg-white p-6 rounded-lg shadow-sm border border-gray-200">
              <div className="flex items-center gap-2 mb-4">
                <Timer className="h-5 w-5 text-blue-600" />
                <h2 className="text-xl font-semibold">Qualifying</h2>
              </div>
              <div className="space-y-4">
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">
                    Grid Position
                  </label>
                  <input
                    type="number"
                    name="gridPosition"
                    value={formData.gridPosition}
                    onChange={handleInputChange}
                    className="w-full p-2 border rounded-md focus:ring-2 focus:ring-blue-500"
                    min="1"
                    max="20"
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">
                    Q1 Time (seconds)
                  </label>
                  <input
                    type="number"
                    name="q1Time"
                    value={formData.q1Time}
                    onChange={handleInputChange}
                    className="w-full p-2 border rounded-md focus:ring-2 focus:ring-blue-500"
                    step="0.001"
                  />
                </div>
                {/* Add Q2 and Q3 similarly */}
              </div>
            </div>

            {/* Team Performance */}
            <div className="bg-white p-6 rounded-lg shadow-sm border border-gray-200">
              <div className="flex items-center gap-2 mb-4">
                <Trophy className="h-5 w-5 text-blue-600" />
                <h2 className="text-xl font-semibold">Team Performance</h2>
              </div>
              <div className="space-y-4">
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">
                    Constructor
                  </label>
                  <select
                    name="constructor"
                    value={formData.constructor}
                    onChange={handleInputChange}
                    className="w-full p-2 border rounded-md focus:ring-2 focus:ring-blue-500"
                  >
                    {constructors.map((team, index) => (
                      <option key={team} value={index}>{team}</option>
                    ))}
                  </select>
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">
                    Team Points
                  </label>
                  <input
                    type="number"
                    name="teamPoints"
                    value={formData.teamPoints}
                    onChange={handleInputChange}
                    className="w-full p-2 border rounded-md focus:ring-2 focus:ring-blue-500"
                  />
                </div>
              </div>
            </div>

            {/* Race Information */}
            <div className="bg-white p-6 rounded-lg shadow-sm border border-gray-200">
              <div className="flex items-center gap-2 mb-4">
                <Flag className="h-5 w-5 text-blue-600" />
                <h2 className="text-xl font-semibold">Race Information</h2>
              </div>
              <div className="space-y-4">
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">
                    Track
                  </label>
                  <select
                    name="track"
                    value={formData.track}
                    onChange={handleInputChange}
                    className="w-full p-2 border rounded-md focus:ring-2 focus:ring-blue-500"
                  >
                    {tracks.map((track, index) => (
                      <option key={track} value={index}>{track}</option>
                    ))}
                  </select>
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">
                    Race Round
                  </label>
                  <input
                    type="number"
                    name="raceRound"
                    value={formData.raceRound}
                    onChange={handleInputChange}
                    className="w-full p-2 border rounded-md focus:ring-2 focus:ring-blue-500"
                    min="1"
                    max="23"
                  />
                </div>
              </div>
            </div>
          </div>

          {/* Submit Button */}
          <button
            type="submit"
            disabled={loading}
            className={`w-full py-3 px-4 rounded-md text-white font-semibold ${
              loading 
                ? 'bg-blue-400 cursor-not-allowed' 
                : 'bg-blue-600 hover:bg-blue-700'
            } transition-colors`}
          >
            {loading ? 'Making Predictions...' : 'Predict Race Outcome'}
          </button>
        </form>

        {/* Predictions Display */}
        {predictions && (
          <div className="mt-8">
            <div className="bg-white p-6 rounded-lg shadow-sm border border-gray-200">
              <div className="flex items-center gap-2 mb-6">
                <Award className="h-6 w-6 text-blue-600" />
                <h2 className="text-2xl font-semibold">Race Predictions</h2>
              </div>
              <div className="grid grid-cols-2 md:grid-cols-4 gap-6">
                {Object.entries(predictions).map(([outcome, probability]) => (
                  <div key={outcome} className="text-center">
                    <PredictionGauge value={probability} label={outcome} />
                  </div>
                ))}
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default F1Predictor;
